import React from 'react';
import { styled } from '@mui/system';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/Inbox';
import MailIcon from '@mui/icons-material/Mail';
import { Grid, Button } from '@mui/material';

const StyledDrawer = styled(Drawer)(({ theme }) => ({
  width: 240,
  flexShrink: 0,
  '& .MuiDrawer-paper': {
    width: 240,
  },
}));

const NavigationBarContainer = styled(Grid)(({ theme }) => ({
  marginTop: theme.spacing(2),
}));

export default function NavigationBar() {
  return (
    <NavigationBarContainer container direction="column" justifyContent="flex-start" alignItems="center" spacing={2} >
      <StyledDrawer variant="permanent" anchor="left" sx={{marginTop: "90"}}>
        <List>
          <ListItem button>
            <ListItemIcon>
              <InboxIcon />
            </ListItemIcon>
            <ListItemText primary="Inbox" />
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <MailIcon />
            </ListItemIcon>
            <ListItemText primary="Mail" />
          </ListItem>
        </List>
      </StyledDrawer>
    </NavigationBarContainer>
  );
}
